var tipuesearch = {"pages": [{'title': '課程認知及簡介', 'text': '網際內容管理，課程目的「利用網路快速運算及連結能力進行數位化協同設計」。 \n \n 自我認知 \n \n 這學期雖然前半段都在懵懵懂懂中度過，影片看了無數次、上課認真聽都還是不懂，起先以為我是「自以為認真」所以才會如此，向其他學長詢問後，他們表示這是正常情況，但只要跟隨著上課進度以及影片內容慢慢架構起來就會步上軌道。目前看起來，大致正確。 \n \n', 'tags': '', 'url': '課程認知及簡介.html'}, {'title': '近端配置及管理', 'text': '', 'tags': '', 'url': '近端配置及管理.html'}, {'title': '網路連線設定', 'text': '遇無法順利上網應依序以下設定是否無誤；若還是不能發現獲解決問題，請立即舉手向老師詢問/求助於同組同學。 \n \n 檢查網路線是否連接正常 \n Windows Network Setting \n \n 大部分情況下，在BGA0810教室皆是 透過 IPv4 協定下的 DHCP 與 NAT 上網，且使用\xa0192.168.1.* 的網路位址。 \n \n (插入ipconfig圖片) \n \n Chrome Proxy \n \n 然後以 NAT 的一組外部 IP 上網, 通常必須設定 Proxy Server 為 http://proxy.kmol.info:3128 後上網會比較順暢，但第十三周為特殊情況僅剩下140.130.17.3可用。 \n (插入nslookup圖片) \n \n', 'tags': '', 'url': '網路連線設定.html'}, {'title': '隨身系統', 'text': '隨身碟當中通常內設的格式為FAT32/exFAT ，若要載入大型檔案(4GB以上)將會受阻，所以在要放入Ubuntu 18.04 vdi 檔案之前, 需先將隨身碟格式化為 NTFS，否則就算隨身碟內仍有許多檔案仍會無法執行成功。 (格式化前記得先將資料備份!) \n', 'tags': '', 'url': '隨身系統.html'}, {'title': '倉儲內容改版', 'text': '甚麼?!竟然有考古題，太棒了~期中考不用擔心了，趕快按下按鈕取得考古題吧! \n \n \n \n 取得考古題 \n \n \n \n \n \n \n \n TRY IT \n \n \n \n', 'tags': '', 'url': '倉儲內容改版.html'}, {'title': 'ROC Flag', 'text': '\n  啟動 Brython  \n \n \n \n \n', 'tags': '', 'url': 'ROC Flag.html'}, {'title': '目錄結構', 'text': '第二位想要編輯這裡 \n \n CMSimfly 的動態系統採用 Python3 + Flask 建構, 並且利用 Beatifulsoup 解讀位於 contig 目錄中的 content.htm 超文件檔案. \n content.htm 檔案可以透過動態系統中的 generate_pages 功能, 將超文件轉為位於 content 目錄中的個別頁面檔案. \n 動態系統與靜態系統則共用 downloads, images, static 等目錄, 其中 downloads 目錄存放在動態系統上傳的文件檔, 而 images 目錄則存放動態系統所上傳的影像檔案, 包括 jpg, png 與 gif 等格式圖檔. \n static 目錄則存放在動態與靜態系統所需要的 Javascript 或 Brython 程式檔. \n 還有這裡 \n 首先修改這裡 \n \n \n \n', 'tags': '', 'url': '目錄結構.html'}, {'title': '期中報告', 'text': '影片網址: https://www.youtube.com/watch?v=wGmXj0XgLqU \n 開啟字幕，獲得註解 \n \n', 'tags': '', 'url': '期中報告.html'}, {'title': '期末報告', 'text': '', 'tags': '', 'url': '期末報告.html'}]};